workflows:
  default-workflow:
    name: Default Workflow
    max_build_duration: 90
    environment:
      vars:
        CM_CERTIFICATE: Encrypted()
        CM_CERTIFICATE_PASSWORD: Encrypted(Z0FBQUFBQmU4YlpzQTRKM3hqb3BaaVpIUHhuS2ZMdjluQjBvZ1JfVnZTVUUxYlVmLWFab1V1WHVzRVJDZGI0aktfZzVvbUg5dzVIQ1l5SEVMVGM5NXdLeFFIR1pLcjZjVkE9PQ==)
        CM_PROVISIONING_PROFILE: Encrypted()
      flutter: stable
      xcode: latest
      cocoapods: default
    triggering:
      events:
        - push
      branch_patterns:
        - pattern: '*'
          include: true
          source: true
    scripts:
      - cd . && flutter packages pub get
      - find . -name "Podfile" -execdir pod install \;
      - keychain initialize
      - |
        # set up provisioning profiles
        PROFILES_HOME="$HOME/Library/MobileDevice/Provisioning Profiles"
        mkdir -p "$PROFILES_HOME"
        PROFILE_PATH="$(mktemp "$PROFILES_HOME"/$(uuidgen).mobileprovision)"
        echo ${CM_PROVISIONING_PROFILE} | base64 --decode > $PROFILE_PATH
        echo "Saved provisioning profile $PROFILE_PATH"
      - |
        # set up signing certificate
        echo $CM_CERTIFICATE | base64 --decode > /tmp/certificate.p12
        keychain add-certificates --certificate /tmp/certificate.p12 --certificate-password $CM_CERTIFICATE_PASSWORD
      - cd . && flutter build ios --debug --no-codesign
      - xcode-project use-profiles
      - cd . && xcode-project build-ipa --workspace "ios/Runner.xcworkspace" --scheme
        "Runner"
    artifacts:
      - build/ios/ipa/*.ipa
      - /tmp/xcodebuild_logs/*.log
      - flutter_drive.log
    publishing:
      email:
        recipients:
          - vuonghuynhlong@gmail.com
  default-workflow-(copy):
    name: Default Workflow (Copy)
    max_build_duration: 75
    environment:
      vars:
        CERTIFICATE_PRIVATE_KEY: Encrypted()
        APP_STORE_CONNECT_KEY_IDENTIFIER: Follow https://developer.apple.com/documentation/appstoreconnectapi/creating_api_keys_for_app_store_connect_api#3028599
          to generate the key
        APP_STORE_CONNECT_PRIVATE_KEY: Follow https://developer.apple.com/documentation/appstoreconnectapi/creating_api_keys_for_app_store_connect_api#3028598
          to download the key
        APP_STORE_CONNECT_ISSUER_ID: Get it from https://appstoreconnect.apple.com/access/api
      flutter: stable
      xcode: latest
      cocoapods: default
    scripts:
      - cd . && flutter packages pub get
      - find . -name "Podfile" -execdir pod install \;
      - keychain initialize
      - app-store-connect fetch-signing-files "$(xcode-project detect-bundle-id)"
        --type IOS_APP_DEVELOPMENT --create
      - keychain add-certificates
      - cd . && flutter build ios --debug --no-codesign
      - xcode-project use-profiles
      - cd . && xcode-project build-ipa --workspace "ios/Runner.xcworkspace" --scheme
        "Runner"
    artifacts:
      - build/ios/ipa/*.ipa
      - /tmp/xcodebuild_logs/*.log
      - flutter_drive.log
    publishing:
      email:
        recipients:
          - vuonghuynhlong@gmail.com
